Detailed solution
If Anna is daughter of Alex, then she is grandson of parents of Alex. Anna is daughter of Ben. Coherence requires that she is father. You can as follows reconstruct relationship from one to another.
Anna – daughter of Ben (Generation 1);
Alex – son of Ben (Generation 2);
Ben – son of Luke (Generation 3);
Alex – father of Anna (Generation 4);
Ben is the brother of Alex and both are children of Luke.
Only when there is a pair with the first and last common factor you can infer relationship. In this case, Anna and Luke are grandfather and nephew of Sam.
There is no more information that allows you to restore relationship of one couple separately from the others. You can assume but not reconstruct with the help of available information.
